import React from "react";


function Food({ name, picture }) {
  return (
      <div>
        <h2>I like {name}</h2>
        <img src={picture} />
      </div>
    );
}

const foodILike = [
  {
    name: "kimchi",
    image:"data:image/jpeg;base64,"
  },
  {
    name: "bulgogi",
    image:"data:image/jpeg;base64,"
  },
  {
    name: "kimbap",
    image:"data:image/jpeg;base64,"
  },
  {
    name: "kimchijjijae",
    image:"data:image/jpeg;base64,"
  }]

function App() {
  return (
    <div>
      {foodILike.map(dish => (
        <Food name={dish.name} picture={dish.image} />
      ))}      
    </div>
  );
}

export default App;
